import React from "react"
import ReactDOM from "react-dom"
import "./styles.css"

function sumNums(a, b) {
  return a + b
}

function showName() {
  return (
    <div>
      <h1>Guilherme Rocha did a sum!</h1>
      <h2>Take a look at the sum:</h2>
      <p className="yellow-bold">Sum: {sumNums(4, 5)}</p>
    </div>
  )
}

const App = () => {

  return (
    <div className="App">
      {showName()}
    </div>
  )
}

const rootElement = document.getElementById('root')
ReactDOM.render(<App />, rootElement)
